import React from 'react';

import './header.css';

import logo from '../image/808.jpg';
import Navigator from '../items/navigator';

const Header = () => {
  const [showMenu, setShowMenu] = useC
  return (
    <header>
      <img className="mainLogo" src={logo} alt="logo" width={'50px'} />
      <Navigator />
    </header>
  );
};

export default Header;
